(377, 137, '_form', '<div class=\"titre\" align=\"center\">\n<h2>FORMULAIRE D\'INSCRIPTION en ligne</h2>\n</div>\n<div class=\"form-group\"><label class=\"col-sm-4 control-label\">Prénom et nom :</label><div class=\"col-sm-8\">[text* your-name class:form-control]</div></div>\n<div class=\"form-group\"><label class=\"col-sm-4 control-label\">Votre âge :</label><div class=\"col-sm-8\">[text* your-age class:form-control]</div></div>\n<div class=\"form-group\"><label class=\"col-sm-4 control-label\">Forfait / Jours et heure du cours (<a href=\"http://omgaya.com/horaire/\" target=\"_blank\" class=\"pink\">horaire ici</a>) :</label><div class=\"col-sm-8\">[select* your-forfait class:form-control \"Lundi 10h00 à 11h30 - YOGA (210$ avec Lucie)\" \"Lundi 13h30 à 15h00 - YOGA (210$ avec Lucie)\" \"Lundi 17h30 à 19h00 - YOGA (210$ avec Lucie)\" \"Lundi 19h30 à 21h00 - YOGA (210$ avec Lucie)\" \"Mardi 6h30 à 7h45 - YOGA (190$ avec Lucie)\" \"Mardi 17h30 à 19h00 INITIATION AU YOGA (210$ avec Marie-Josée)\" \"Mardi 19h30 à 21h00 - POWER YOGA (210$ avec Lucie)\" \"Mercredi 13h30 à 15h00 -STRETCHING (210$ avec Lucie)\" \"Mercredi 16h30 à 17h30 - YOGA (175$ avec Lucie)\" \"Mercredi 17h45 à 19h00 - STRETCHING (190$ avec Lucie)\" \"Mercredi 19h30 à 21h00 - YOGA (210$ avec Lucie)\" \"Jeudi 17h30 à 19h00 YOGA DOUX (210$ avec Marie-Josée)\" \"Jeudi 19h30 à 21h00 - YIN YOGA (210$ avec Marie-Josée)\" \"Vendredi 9h00 à 10h15 YOGA PÉRINATAL (175$ 10 cours seulement)\" \"Vendredi 10h45 à 11h45 - YOGA MAMAN-BÉBÉ (150$)\" \"Samedi 9h00 à 9h45 YOGA ENFANT 3-6 ans (100$ avec Lucie, 8 cours seulement)\" \"Samedi 10h15 à 11h00 - YOGA ENFANT 7-11 ans (100$ avec Lucie, 8 cours seulement)\"]</div></div>\n<div class=\"form-group\"><label class=\"col-sm-4 control-label\">Que faites-vous comme travail et votre position de travail (ex.: assis-debout, ordi., téléphone, mouvements...)?</label><div class=\"col-sm-8\">[text* your-work class:form-control]</div></div>\n<div class=\"form-group\"><label class=\"col-sm-4 control-label\">Adresse postale :</label><div class=\"col-sm-8\">[text* your-adresse class:form-control]</div></div>\n<div class=\"form-group\"><label class=\"col-sm-4 control-label\">Ville :</label><div class=\"col-sm-8\">[text* your-ville class:form-control]</div></div>\n<div class=\"form-group\"><label class=\"col-sm-4 control-label\">Code Postal :</label><div class=\"col-sm-8\">[text* your-cp class:form-control]</div></div>\n<div class=\"form-group\"><label class=\"col-sm-4 control-label\">Téléphone :</label><div class=\"col-sm-8\">[text* your-telephone class:form-control]</div></div>\n<div class=\"form-group\"><label class=\"col-sm-4 control-label\">Autre téléphone :</label><div class=\"col-sm-8\">[text* your-telephoneautre class:form-control]</div></div>\n<div class=\"form-group\"><label class=\"col-sm-4 control-label\">Fax :</label><div class=\"col-sm-8\">[text your-fax class:form-control]</div></div>\n<div class=\"form-group\"><label class=\"col-sm-4 control-label\">Courriel :</label><div class=\"col-sm-8\">[text* your-email class:form-control]</div></div>\n<div class=\"form-group\"><label class=\"col-sm-4 control-label\">En choisissant le yoga, quel est votre but?</label><div class=\"col-sm-8\">[textarea your-but class:form-control]</div></div>\n<br style=\"clear:both;\">\n<div class=\"titre\" align=\"center\">\n<h2>État de santé et informations médicales</h2>\n</div>\n<div class=\"form-group\"><label class=\"col-sm-4 control-label\">Cochez si vous avez l\'une ou plusieurs de ces conditions:</label><div class=\"col-sm-8\">[checkbox your-condition use_label_element \"Haute pression\" \"Basse pression\" \"Maux de tête / migraine\" \"Fibromyalgie\" \"Insomnie\" \"Grossesse\"]</div></div>\n<div class=\"form-group\"><label class=\"col-sm-4 control-label\">Grossesse: # de la semaine</label><div class=\"col-sm-8\">[text your-grossesse-semaine class:form-control]</div></div>\n<div class=\"form-group\"><label class=\"col-sm-4 control-label\">Affection du système nerveux:</label><div class=\"col-sm-8\">[checkbox your-systeme-nerveux use_label_element \"Je souffre d\'évanouissements.\" \"Je souffre d\'épilepsie.\" \"J\'ai souffert de traumatisme crânien dernièrement.\" \"Je souffre de désordrese cervicaux ou neurologique autre que ceux mentionnées ci-haut.\"]</div></div>\n<div class=\"form-group\"><label class=\"col-sm-4 control-label\">Affection respiratoire:</label><div class=\"col-sm-8\">[checkbox your-respiration use_label_element \"Je souffre d\'asthme ou de bronchite chronique.\"]</div></div>\n<div class=\"form-group\"><label class=\"col-sm-4 control-label\">Problème rénal:</label><div class=\"col-sm-8\">[checkbox your-renal use_label_element \"Je souffre d\'une maladie rénale quelle qu\'elle soit.\"]</div></div>\n<div class=\"form-group\"><label class=\"col-sm-4 control-label\">Problèmes musculo-squelettiques:</label><div class=\"col-sm-8\">[checkbox your-squelette use_label_element \"J\'ai une limitation de mouvement d\'un de mes membres ou de la colonne vertébrale\" \"Je souffre de faiblesse musculaire.\"]</div></div>\n<div class=\"form-group\"><label class=\"col-sm-4 control-label\">Problème systématique:</label><div class=\"col-sm-8\">[checkbox your-diabete use_label_element \"Je souffre de diabète.\"]</div></div>\n<div class=\"form-group\"><label class=\"col-sm-4 control-label\">Problèmes cardio-vasculaire:</label><div class=\"col-sm-8\">[checkbox your-cardiovasculaire use_label_element \"Je souffre d\'une affection cardiaque ou vasculaire.\"]</div></div>\n<div class=\"form-group\"><label class=\"col-sm-4 control-label\">Y\'a-t-il des médicaments que le professeur devrait vous donner en cas d\'urgence pendant un cours?</label><div class=\"col-sm-8\">[text your-medicaments class:form-control]</div></div>\n<div class=\"form-group\"><label class=\"col-sm-4 control-label\">Autres conditions:</label><div class=\"col-sm-8\">[checkbox your-autres-conditions use_label_element \"J\'ai subi une intervention chirurgicale dernièrement\" \"Je souffre de maladie(s) ou affection(s) autres que celle mentionnés.\"]\nSi oui, expliquez ici:\n[text your-explication class:form-control]</div></div>\n<div class=\"form-group\"><label class=\"col-sm-4 control-label\">Autres choses à mentionner:</label><div class=\"col-sm-8\">[textarea your-autre-choses class:form-control]</div></div>\n<div class=\"form-group\"><label class=\"col-sm-4 control-label\"></label><div class=\"col-sm-8\">[checkbox* your-confirmation-sante use_label_element \"En cochant cette case, j\'accepte d\'être responsable de ma santé, de ma sécurité et de mon bien-être. Je m\'engage à informer mon professeur de toute activité. qui met en doute ma sécurité et qui est susceptible de me causer une blessure. Ainsi que tout changement à ma santé susceptible de modifier la pratique de yoga.\"]</div></div>\n\n<p>[submit class:btn \"Envoyer\"]</p>'),
(378, 137, '_mail', 'a:8:{s:7:\"subject\";s:25:\"Inscription - [your-name]\";s:6:\"sender\";s:26:\"[your-name] <[your-email]>\";s:4:\"body\";s:1472:\"De : [your-name] <[your-email]>\nSujet : Inscription - [your-name]\n\n<strong>Coordonnées ------------------------------</strong>\n<strong>Nom :</strong> [your-name]\n<strong>Âge :</strong> [your-age]\n<strong>Forfait :</strong> [your-forfait]\n<strong>Travail :</strong> [your-work]\n<strong>Adresse :</strong> [your-adresse]\n<strong>Ville :</strong> [your-ville]\n<strong>CP :</strong> [your-cp]\n<strong>Téléphone :</strong> [your-telephone]\n<strong>Téléphone autre :</strong> [your-telephoneautre]\n<strong>Fax :</strong> [your-fax]\n<strong>Courriel :</strong> [your-email]\n\n<strong>Informations conditions ------------------------------</strong>\n<strong>But :</strong> [your-but]\n<strong>Conditions :</strong> [your-condition]\n<strong>Semaine de grossesse :</strong> [your-grossesse-semaine]\n<strong>Système nerveux :</strong> [your-systeme-nerveux]\n<strong>Respiration :</strong> [your-respiration]\n<strong>Rénal :</strong> [your-renal]\n<strong>Squelette :</strong> [your-squelette]\n<strong>Diabète :</strong> [your-diabete]\n<strong>Cardio vasculaire :</strong> [your-cardiovasculaire]\n<strong>Médicaments :</strong> [your-medicaments]\n<strong>Autre conditions :</strong> [your-autres-conditions]\n<strong>Explication :</strong> [your-explication]\n<strong>Autres choses :</strong> [your-autre-choses]\n<strong>Confirmation :</strong> [your-confirmation-sante]\n\n--\nCet email a été envoyé via le formulaire d\'inscription de Om Gaya - Studio de Yoga (http://omgaya.com)\";s:9:\"recipient\";s:39:\"dhebert@reactif.ca, max@studioozone.com\";s:18:\"additional_headers\";s:22:\"Reply-To: [your-email]\";s:11:\"attachments\";s:0:\"\";s:8:\"use_html\";b:0;s:13:\"exclude_blank\";b:0;}'),
