(148, 2, '2015-12-03 11:25:13', '2015-12-03 16:25:13', 'La pratique du yoga vous apprend à mieux connaître votre corps physique et à vous intérioriser. Apprendre à se connaître est une richesse qui améliore la santé et le bien-être. C’est un coffre d’outils pour la vie.\r\n\r\nPour plus d\'information, allez dans la section <a href=\"http://omgaya.com/cours/\">Cours</a> de notre site web pour voir la description de chacun de nos cours.', 'Achat cours & retraites', '<h2>Session printemps 2017</h2>\r\n<h4>Du 24 avril au 16 juin 2017</h4>\r\n&nbsp;', 'publish', 'closed', 'closed', '', 'achatcoursretraites', '', '', '2017-03-17 17:11:17', '2017-03-17 21:11:17', '', 0, 'http://omgaya.com/?post_type=product&#038;p=148', 0, 'product', '', 0),
