(26949, '_transient_dash_bd94b8f41e74bae2f4dc72e9bd8379af', '<div class=\"rss-widget\"><ul><li><a class=\'rsswidget\' href=\'http://feedproxy.google.com/~r/WordpressFrancophone/~3/_z7qQytCHB8/\'>Les résultats du grand sondage de la communauté francophone de WordPress</a> <span class=\"rss-date\">juillet 14, 2017</span><div class=\"rssSummary\">Fin mai, un grand sondage était lancé par Maxime Bernard-Jacquet au nom de la communauté francophone de WordPress afin de mieux identifier comment elle se composait ! Aujourd’hui les résultats sont disponibles. La première statistique intéressante est la participation, puisque ce sont 1000 personnes qui ont répondues à ce questionnaire. Ceci permet donc d’avoir desLire [&hellip;]</div></li></ul></div><div class=\"rss-widget\"><ul><li><a class=\'rsswidget\' href=\'http://feedproxy.google.com/~r/wpfr/~3/jSSJEan_G5E/\'>Ajouter les custom post types dans l’encart « D’un coup d’oeil » de l’administration</a></li><li><a class=\'rsswidget\' href=\'http://feedproxy.google.com/~r/wpfr/~3/AXBcrR158As/\'>Comment proposer un support WordPress sur mesure ?</a></li><li><a class=\'rsswidget\' href=\'http://feedproxy.google.com/~r/wpfr/~3/3R7QXBaOqg4/movavi-montages-videos-12143.html\'>Movavi pour vos montages vidéos</a></li></ul></div><div class=\"rss-widget\"><ul><li class=\"dashboard-news-plugin\"><span>Extensions populaires :</span> Jetpack by WordPress.com&nbsp;<a href=\"plugin-install.php?tab=plugin-information&amp;plugin=jetpack&amp;_wpnonce=96cd1b4578&amp;TB_iframe=true&amp;width=600&amp;height=800\" class=\"thickbox open-plugin-details-modal\" aria-label=\"Installer Jetpack by WordPress.com\">(Installer)</a></li></ul></div>', 'no'),
