(15000, 1006, 'titre', 'Apercu'),
(15001, 1006, '_titre', 'field_598b02ef34f85'),
(15002, 1006, 'paragraphe', 'Cette abatteuse-groupeuse à rayon ultra court sur chenilles de ELTEC est conçue et spécialisée pour fournir une haute productivité conséquente avec les exigences d\'une opération forestière en coupe sélective ou normal, 7 jours sur 7. La série ELTEC 220 est alimenté par un moteur diesel Cummins leader de l\'industrie, à consommation de carburant ultraefficace et d\'un système hydraulique rehaussé pour les opérations forestières. Le confort et la sécurité de l\'opérateur sont des fais saillants de cette abatteuse-groupeuse puisqu\'elle est munie d\'une cabine ELTEC de nouvelle conception conviviale.\r\n\r\nLa configuration d\'abatteuse multifonctionnelle est aussi offerte sur les machines de la Série ELTEC 220 avec flèche et balancier de longue portée ainsi qu\'un système hydraulique adapté.'),
