(971, 1, '2017-05-31 14:14:33', '2017-05-31 18:14:33', 'By default, clicking on the <code>more</code> link will take the reader to the single-post view <strong>at the location where the <code>more</code> tag is specified in the source code</strong>. Thus, if you are using default <code>more</code>-tag functionality, your visitors are being thrown halfway-down your post after clicking on the <code>more</code> link. At one time, this seemed like a good idea, but the convention is now to simply open the post-view without jumping to any particular point in the page.<!--more-->\r\n\r\nAll of that to say this: if you want the <code>more</code> link to open the post-view at the <em>top</em> of the page, slap this little gem into your active theme’s <code>functions.php</code> file:', 'Technologie', '', 'inherit', 'closed', 'closed', '', '970-revision-v1', '', '', '2017-05-31 14:14:33', '2017-05-31 18:14:33', '', 970, 'http://localhost/Eltec/web/970-revision-v1/', 0, 'revision', '', 0),
