(975, 1, '2017-05-31 14:52:20', '2017-05-31 18:52:20', 'The most appropriate use for <tt>get_posts</tt> is to create an array of posts based on a set of parameters. It retrieves a list of recent posts or posts matching this criteria. <tt>get_posts</tt> can also be used to create <a title=\"The Loop\" href=\"https://codex.wordpress.org/The_Loop#Multiple_Loops\">Multiple Loops</a>, though a more direct reference to <tt><a title=\"Class Reference/WP Query\" href=\"https://codex.wordpress.org/Class_Reference/WP_Query\">WP_Query</a></tt> using <tt>new WP_Query</tt> is preferred in this case.<!--more-->\r\n\r\nThe parameters of <tt>get_posts</tt> are similar to those of <tt><a title=\"Function Reference/get pages\" href=\"https://codex.wordpress.org/Function_Reference/get_pages\">get_pages</a></tt> but are implemented quite differently, and should be used in appropriate scenarios. <tt>get_posts</tt> uses <tt><a title=\"Class Reference/WP Query\" href=\"https://codex.wordpress.org/Class_Reference/WP_Query\">WP_Query</a></tt>, whereas <tt>get_pages</tt> queries the database more directly. Each have parameters that reflect this difference in implementation.', 'Forestiers', '', 'inherit', 'closed', 'closed', '', '974-revision-v1', '', '', '2017-05-31 14:52:20', '2017-05-31 18:52:20', '', 974, 'http://localhost/Eltec/web/974-revision-v1/', 0, 'revision', '', 0),
