(1003, 1, '2017-06-01 10:19:09', '2017-06-01 14:19:09', 'Fusce at cursus purus. Vestibulum ac metus nec dolor porta sodales. In tincidunt a dolor a aliquam. Cras tincidunt gravida nunc, sit amet mattis massa faucibus id. Suspendisse imperdiet auctor ligula, pharetra viverra risus sollicitudin ac. Phasellus facilisis aliquet urna nec congue. Maecenas tristique velit lorem, vel efficitur orci interdum sed. Pellentesque urna nulla, auctor vel orci sed, fringilla tincidunt mi. Nam convallis, leo ac elementum ultrices, ex enim tincidunt justo, vitae molestie ante tortor ac ipsum. Proin non neque tortor. Phasellus tortor orci, fringilla in sem in, commodo molestie sapien. Aliquam dignissim ut dui a fringilla.', 'groupe élément', '', 'publish', 'closed', 'closed', '', 'groupe-element', '', '', '2017-08-07 14:45:35', '2017-08-07 18:45:35', '', 905, 'http://localhost/Eltec/web/?page_id=1003', 0, 'page', '', 0),
