(1106, 1, '2017-06-05 17:23:57', '2017-06-05 21:23:57', 'Technologies Éléments PSW inc. est une division nouvellement créée par le Groupe Élément. En unissant leur force, les entreprises du Groupe Élément sont devenues des joueurs de première ligne dans la région et dans la province. En plus d\'être un chef de file du secteur forestier, le Groupe élément est spécialisé dans la vente, la réparation et maintenant dans la fabrication d\'équipements lourds de qualité supérieur.', 'à propos', '', 'inherit', 'closed', 'closed', '', '905-autosave-v1', '', '', '2017-06-05 17:23:57', '2017-06-05 21:23:57', '', 905, 'http://localhost/Eltec/web/905-autosave-v1/', 0, 'revision', '', 0),
(1107, 1, '2017-06-05 17:06:49', '2017-06-05 21:06:49', 'Technologies Éléments PSW inc. est une division nouvellement créée par le Groupe Élément. En unissant leur force, les entreprises du Groupe Élément sont devenues des joueurs de première ligne dans la région et dans la province. En plus d\'être un chef de file du secteur forestier, le Groupe élément est spécialisé dans la vente, la réparation et maintenant dans la fabrication d\'équipements lourds de qualité supérieur.', 'à propos', '', 'inherit', 'closed', 'closed', '', '905-revision-v1', '', '', '2017-06-05 17:06:49', '2017-06-05 21:06:49', '', 905, 'http://localhost/Eltec/web/905-revision-v1/', 0, 'revision', '', 0),
(1108, 1, '2017-06-06 13:08:22', '2017-06-06 17:08:22', '[row]\n[column lg=\"7\" md=\"12\" sm=\"12\" xs=\"12\" ]\nEn 2011, Techonologies Éléments PSW inc., présidé par M.Patrick Éléeàment, achète de Volvo sa division abateuse et se lance dans la fabrication de machinerie forestière. Auparavant, les abateuses étaient produites en Corée, mais maintenant les trois modèles d\'abateuses sous la marque ELTEC seront fabriquées à Val-d\'Or. Une première pour la région de l\'Abitibi-Témiscamingue. C\'est dans des batiments de plus de 21 000 pieds carrées ainsi qu\'une équipe de recherche et de développement à Québec que le tout se réalisera. L\'objectif de Technologie Élément PSW inc est de fournir plus d\"une quarantaine d\'abateuse ELTEC dans une année sous une ligne de montage très précise et à la main. Avec plus de vingt-cinq employés à son actif, plusieurs autres postes seront à combler dans les prochaines années. La série ELTEC, conçue pour la performance et contruite pour durer, vont faire de Technologie Éléments PSW inc. une légende dans le domaine de la foresterie.\n[/column]\n[column lg=\"5\" md=\"12\" sm=\"12\" xs=\"12\" ]\n[toggles class=\"listeAccordeon\"]\n[toggle title=\"Aujourd\'hui, les cinq entreprises du groupe élément sont:\" class=\"in\"]\n\nLes Abateurs Jacques Élément\n\nForesco\n\nHydraulique Val-d\'Or\n\nÉquipements Élément\n\nTechnologi\n\n[/toggle]\n[/toggles]\n[/column]\n[/row]\n\n&nbsp;', 'qui nous sommes', '', 'inherit', 'closed', 'closed', '', '995-autosave-v1', '', '', '2017-06-06 13:08:22', '2017-06-06 17:08:22', '', 995, 'http://localhost/Eltec/web/995-autosave-v1/', 0, 'revision', '', 0),
