ré, moteurs à piston à déplacement variable avec soupapes compensées pour protection contre la survitesse et rétrogradation automatique de moteur avec mécanisme de surpassement et défreinage sont tous standards.', 'série 220', '', 'inherit', 'closed', 'closed', '', '1006-revision-v1', '', '', '2017-06-06 11:47:00', '2017-06-06 15:47:00', '', 1006, 'http://localhost/Eltec/web/1006-revision-v1/', 0, 'revision', '', 0),
