 rampes à chaque bout. Roues folles hermétiques, dispositif tendeur robuste, engrenage planétaire de traction à couple élevé avec freins à disques sûreté intégré, moteurs à piston à déplacement variable avec soupapes compensées pour protection contre la survitesse et rétrogradation automatique de moteur avec mécanisme de surpassement et défreinage sont tous standards.\r\n[/column]\r\n[column lg=\"5\" md=\"12\" sm=\"12\" xs=\"12\" ]\r\n\r\n[toggles class=\"listeAccordeon\"]\r\n[toggle title=\"Puissance et capacité\" class=\"in\"]\r\n<ul>\r\n 	<li>Puissance brute du moteur. 239 kw / 320 hp</li>\r\n 	<li>Poids d\'opération de base (sans attachements 27,200 kg / 60,000 lbs avec train porteur forestier service standard de ELTEC 29,500 kg 65,000 lbs avec train forestier service renforcé de ELTECT 29,900 kg / 65,700 lbs avec tain porteur forestier service extrême de ELTEC</li>\r\n</ul>\r\n[/toggle]\r\n[toggle title=\"Moteur\"][/toggle]\r\n[toggle title=\"performance\"][/toggle]\r\n[toggle title=\"technologie\"][/toggle]\r\n[/toggles]\r\n[/column]\r\n[/row]', 'série 310', '', 'inherit', 'closed', 'closed', '', '1010-revision-v1', '', '', '2017-06-06 16:25:46', '2017-06-06 20:25:46', '', 1010, 'http://localhost/Eltec/web/1010-revision-v1/', 0, 'revision', '', 0),
(1136, 1, '2017-06-06 16:47:48', '2017-06-06 20:47:48', '[row]\r\n[column lg=\"7\" md=\"12\" sm=\"12\" xs=\"12\" ]\r\n<h2>Qui nous sommes</h2>\r\nEn 2011, Techonologies Éléments PSW inc., présidé par M.Patrick Éléeàment, achète de Volvo sa division abateuse et se lance dans la fabrication de machinerie forestière. Auparavant, les abateuses étaient produites en Corée, mais maintenant les trois modèles d\'abateuses sous la marque ELTEC seront fabriquées à Val-d\'Or. Une première pour la région de l\'Abitibi-Témiscamingue. C\'est dans des batiments de plus de 21 000 pieds carrées ainsi qu\'une équipe de recherche et de développement à Québec que le tout se réalisera. L\'objectif de Technologie Élément PSW inc est de fournir plus d\"une quarantaine d\'abateuse ELTEC dans une année sous une ligne de montage très précise et à la main. Avec plus de vingt-cinq employés à son actif, plusieurs autres postes seront à combler dans les prochaines années. La série ELTEC, conçue pour la performance et contruite pour durer, vont faire de Technologie Éléments PSW inc. une légende dans le domaine de la foresterie.\r\n[/column]\r\n[column lg=\"5\" md=\"12\" sm=\"12\" xs=\"12\" ]\r\n[toggles class=\"listeAccordeon\"]\r\n[toggle title=\"Aujourd\'hui, les cinq entreprises du groupe élément sont:\" class=\"in\"]\r\n<ul>\r\n 	<li>Les Abateurs Jacques Élément</li>\r\n 	<li>Foresco</li>\r\n 	<li>Hydraulique Val-d\'Or</li>\r\n 	<li>Équipements Élément</li>\r\n 	<li>Technologie Élément PSW</li>\r\n</ul>\r\n[/toggle]\r\n[/toggles]\r\n[/column]\r\n[/row]\r\n\r\n&nbsp;', 'qui nous sommes', '', 'inherit', 'closed', 'closed', '', '995-revision-v1', '', '', '2017-06-06 16:47:48', '2017-06-06 20:47:48', '', 995, 'http://localhost/Eltec/web/995-revision-v1/', 0, 'revision', '', 0),
(1137, 1, '2017-06-06 16:48:10', '2017-06-06 20:48:10', '[row]\r\n[column lg=\"12\" md=\"12\" sm=\"12\" xs=\"12\" ]\r\n<h2>À propos</h2>\r\nTechnologies Éléments PSW inc. est une division nouvellement créée par le Groupe Élément. En unissant leur force, les entreprises du Groupe Élément sont devenues des joueurs de première ligne dans la région et dans la province. En plus d\'être un chef de file du secteur forestier, le Groupe élément est spécialisé dans la vente, la réparation et maintenant dans la fabrication d\'équipements lourds de qualité supérieur.\r\n[/column]\r\n[/row]\r\n\r\n&nbsp;', 'à propos', '', 'inherit', 'closed', 'closed', '', '905-revision-v1', '', '', '2017-06-06 16:48:10', '2017-06-06 20:48:10', '', 905, 'http://localhost/Eltec/web/905-revision-v1/', 0, 'revision', '', 0),
