(1198, 1, '2017-07-12 15:54:04', '2017-07-12 19:54:04', '[row]\r\n[column lg=\"12\" md=\"12\" sm=\"12\" xs=\"12\" ]\r\n<h2>aperçu</h2>\r\nCette abatteuse-groupeuse à rayon ultra court sur chenilles de ELTEC est conçue et spécialisée pour fournir une haute productivité conséquente avec les exigences d\'une opération forestière en coupe sélective ou normal, 7 jours sur 7. La série ELTEC 220 est alimenté par un moteur diesel Cummins leader de l\'industrie, à consommation de carburant ultraefficace et d\'un système hydraulique rehaussé pour les opérations forestières. Le confort et la sécurité de l\'opérateur sont des fais saillants de cette abatteuse-groupeuse puisqu\'elle est munie d\'une cabine ELTEC de nouvelle conception conviviale.\r\n\r\nLa configuration d\'abatteuse multifonctionnelle est aussi offerte sur les machines de la Série ELTEC 220 avec flèche et balancier de longue portée ainsi qu\'un système hydraulique adapté.\r\n[/column]\r\n[/row]\r\n<h2></h2>\r\n[row]\r\n[column lg=\"7\" md=\"12\" sm=\"12\" xs=\"12\" ]\r\n<h2>description</h2>\r\nSur toutes les abatteuses ELTEC, la filtration de l\'air se fait en trois étapes : pré-filtre intégré type cyclone, ainsi que par des filtres primaires et secondaires.\r\n\r\nLe ventilateur réversibles à vitesse variable est contrôlé électroniquement et entraîné hydrauliquement pour réduire la consommation de carburant et le bruit.\r\n\r\nLe refroidissement d\"huile hydraulique, le radiateur et le refroidisseur d\'air de type côte-à-côte et le condensateur de climatisation sont placé de façon à faciliter l\'accès service.\r\n\r\nLa cabine conviviale ELTEC met en valeur un siège chauffant avec ajustement multiples, un système confort d\'opérateur rehaussé et des affichages faciles à lire qui fournissent des informations en temps réel pour toutes les fonctions de la machine.\r\n\r\nLe train porteur forestier avec dégagement au sol élevé est conçu avec protections intégrales des composantes de traction ainsi que des angles de rampes à chaque bout. Roues folles hermétiques, dispositif tendeur robuste, engrenage planétaire de traction à couple élevé avec freins à disques sûreté intégré, moteurs à piston à déplacement variable avec soupapes compensées pour protection contre la survitesse et rétrogradation automatique de moteur avec mécanisme de surpassement et défreinage sont tous standards.\r\n[/column]\r\n[column lg=\"5\" md=\"12\" sm=\"12\" xs=\"12\" ]\r\n\r\n[toggles class=\"listeAccordeon\"]\r\n[toggle title=\"Puissance et capacité\" class=\"in\"]\r\n<ul>\r\n 	<li>Puissance brute du moteur. 239 kw / 320 hp</li>\r\n 	<li>Poids d\'opération de base (sans attachements 27,200 kg / 60,000 lbs avec train porteur forestier service standard de ELTEC 29,500 kg 65,000 lbs avec train forestier service renforcé de ELTECT 29,900 kg / 65,700 lbs avec tain porteur forestier service extrême de ELTEC</li>\r\n</ul>\r\n[/toggle]\r\n[toggle title=\"Moteur\"][/toggle]\r\n[toggle title=\"performance\"][/toggle]\r\n[toggle title=\"technologie\"][/toggle]\r\n[/toggles]\r\n[/column]\r\n[/row]\r\n\r\n&nbsp;\r\n\r\n&nbsp;', 'série 220', '', 'inherit', 'closed', 'closed', '', '1006-revision-v1', '', '', '2017-07-12 15:54:04', '2017-07-12 19:54:04', '', 1006, 'http://localhost/Eltec/web/1006-revision-v1/', 0, 'revision', '', 0),
