(1455, 1, '2017-08-09 10:06:10', '2017-08-09 14:06:10', '<img class=\"aligncenter size-full wp-image-725\" src=\"/Eltec/web/wp-content/uploads/2015/08/Harmony.jpg\" alt=\"\" />\r\n<h3>5 février 2017</h3>\r\nNulla finibus est eget erat lobortis blandit. Ut in pellentesque nisl. Curabitur in molestie erat, eu facilisis orci. Vivamus auctor tempor risus in molestie. Curabitur eu congue justo. Suspendisse in placerat nunc. Proin eget diam ut elit vestibulum luctus in suscipit augue. Aliquam erat volutpat. Sed eget arcu at ex tincidunt dignissim. Aliquam ut tellus id odio rhoncus mollis sed nec quam. Sed dapibus velit at urna vehicula faucibus. Mauris dapibus dolor in posuere consectetur.\r\n\r\n<!--more-->\r\n\r\nProin imperdiet felis libero, rutrum sollicitudin felis viverra efficitur. Sed blandit, nibh ut lobortis aliquet, est elit viverra ante, ut mattis nisl velit nec nisl. Integer rhoncus euismod tristique. Curabitur ultricies accumsan leo, id interdum sem condimentum in. Donec sed pharetra lacus. Nullam faucibus leo nec orci mattis, id feugiat felis elementum. Etiam tincidunt leo condimentum, accumsan magna sed, sodales augue. Integer mattis eget mi vitae dictum. Suspendisse potenti. Donec at risus at arcu imperdiet iaculis', 'nouvelle 5', '', 'inherit', 'closed', 'closed', '', '1074-revision-v1', '', '', '2017-08-09 10:06:10', '2017-08-09 14:06:10', '', 1074, 'http://localhost/Eltec/web/1074-revision-v1/', 0, 'revision', '', 0);
